import Avatar from "@mui/material/Avatar";
import "./Header.css";

function Header() {
  return (
    <div>
      <header>
        <nav>
          <h1>Strugbits Cloud</h1>
          <div className="avatar">
            <Avatar style={{backgroundColor:'bl'}}>S</Avatar>
          </div>
        </nav>
      </header>
    </div>
  );
}

export default Header;
